import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
const handleChange =  ()  => {
var session_url = 'http://localhost:8080/login';
var uname = 'bob';
var pass = 'bobspassword';
axios.post(session_url, {}, {
  auth: {
    username: uname,
    password: pass
  }
}).then(res => {
        console.log(res);
    })
    .catch(err => {
      console.log(err.message);
    });
};

  function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <Button black size="lg" type="submit" 
    onClick={handleChange}
     >login       </Button>
    </div>
  );
}

export default App;
